  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Oak Orchard National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1958. The report begins by summarizing the weather conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, and rodents-
  is also covered. The Refuge development and maintenance section discusses physical
  developments. The public relations section of the report describes Refuge visitors,
  Refuge participation, and hunting. Photographs are attached.\",\n\t\"owner_org\":
